import './App.css';
import {BrowserRouter as Router,Route,Link} from 'react-router-dom'

function nav() {
  return (
    <div>
     <Router>
     <Link to="/">Home</Link>
     <Link to="/">About</Link>
     <Link to="/">Forms</Link>

     <Route path ="/"  component ={home}/>
     <Route path ="/"  component ={About}/>
     <Route path ="/"  component ={Forms}/>
     

     </Router>    
    </div>
  );
}

export default nav;
